        return (p[0] - q[0]) ** 2 + (p[1] - q[0]) ** 2
    points = [p1, p2, p3, p4]
    dists = []
    for i in range(4):
        for j in range(i + 1, 4):
            dists.append(distance(points[i], points[j]))
    dists.sort()
    return dists[0] == dists[1] == dists[2] == dists[3] and dists[4] == dists[5] and (dists[0] < dists[4])

